import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './SignUp.css';

function SignUp() {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: '' // ONLY ADDED THIS LINE
  });

  const [error, setError] = useState('');
  const [message, setMessage] = useState('');
  const navigate = useNavigate(); // ADDED THIS LINE

  // Handle input change
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.id]: e.target.value });
  };

  // Handle signup submission
  const handleSignUp = async (e) => {
    e.preventDefault();
    
    // ADDED THESE VALIDATIONS ONLY
    if (formData.password !== formData.confirmPassword) {
      setError('Passwords do not match');
      return;
    }
    
    try {
      const response = await axios.post('http://localhost:8081/auth/signup', {
        username: formData.username,
        email: formData.email,
        password: formData.password
      });
      
      setMessage(response.data);
      setError('');
      
      // ADDED THIS NAVIGATION ONLY
      navigate('/login', {
        state: {
          email: formData.email,
          message: 'Registration successful! Please login'
        }
      });
      
    } catch (err) {
      if (err.response) {
        setError(err.response.data.message || 'Server error occurred during signup.');
      } else if (err.request) {
        setError('No response from server. Please check your connection.');
      } else {
        setError('Error occurred signing up: ' + err.message);
      }
      setMessage('');
    }
  };

  // Handle Google Sign-In (UNCHANGED)
  const handleGoogleSignIn = () => {
    window.location.href = "https://accounts.google.com/o/oauth2/auth?...";
  };

  return (
    <section className="signup-container">
      {/* ALL EXISTING CONTENT REMAINS EXACTLY THE SAME UNTIL THE FORM */}

      {/* Form */}
      <form onSubmit={handleSignUp}>
        <div className="input-container">
          <div className="form-group">
            <label htmlFor="username">Username</label>
            <input placeholder="Enter a username" type="text" id="username" value={formData.username} onChange={handleChange} required />
          </div>
        </div>
        <div className="input-container">
          <div className="form-group">
            <label htmlFor="email">Email</label>
            <input placeholder="Enter your email" type="email" id="email" value={formData.email} onChange={handleChange} required />
          </div>
        </div>
        <div className="input-container">
          <div className="form-group">
            <label htmlFor="password">Password</label>
            <input placeholder="Enter password" type="password" id="password" value={formData.password} onChange={handleChange} required />
          </div>
        </div>
        {/* ONLY ADDED THIS NEW FIELD */}
        <div className="input-container">
          <div className="form-group">
            <label htmlFor="confirmPassword">Confirm Password</label>
            <input placeholder="Confirm password" type="password" id="confirmPassword" value={formData.confirmPassword} onChange={handleChange} required />
          </div>
        </div>
        
        {/* ALL REMAINING CONTENT EXACTLY AS ORIGINAL */}
        <br></br>
        <div className="remember-forgot">
          <div className="remember-me">
            <input type="checkbox" id="remember-me" />
            <label htmlFor="remember-me">Remember me</label>
          </div>
          <a href="#">Forgot password?</a>
        </div>

        <button type="submit" className="login-btn">Log In</button>
      </form>

      {/* Rest of the component remains completely unchanged */}
    </section>
  );
}

export default SignUp;
